function Get_Cookie(c){var d=document.cookie.indexOf(c+"=");
var b=d+c.length+1;
if((!d)&&(c!=document.cookie.substring(0,c.length))){return null
}if(d==-1){return null
}var a=document.cookie.indexOf(";",b);
if(a==-1){a=document.cookie.length
}return unescape(document.cookie.substring(b,a))
}function Delete_Cookie(c,e,b){if(Get_Cookie(c)){var a=new Date();
document.cookie=c+"="+((e)?";path="+e:"")+((b)?";domain="+b:"")+";expires="+a.toGMTString()+";;"
}};
